code += "00 00 00 00 00 00 00 00 00 00 00 00 00 00 00 00"
code = bytes.fromhex(code.replace(" ", ""))

# Decode to 32bit integers
code = [int.from_bytes(code[i*4:(i+1)*4],byteorder='little') for i in range(len(code)//4)]

# Most used encoding
def defaultTwoOps(codeChunk, opStr):
    encoding = codeChunk[0]

    if encoding == 0:
        fullStr = "regs[%d] = regs[%d] %s memory[regs[%d]] " % (codeChunk[2], codeChunk[2], opStr, codeChunk[3])
    elif encoding == 1:
        fullStr = "regs[%d] = regs[%d] %s 0x%08X" % (codeChunk[2], codeChunk[2], opStr, codeChunk[3])
    elif encoding == 2:
        fullStr = "regs[%d] = regs[%d] %s regs[%d]" % (codeChunk[2], codeChunk[2], opStr, codeChunk[3])
    else:
        fullStr = "???"
    return fullStr
    
# Iterate through the bytecode and disassemble it
for indx in range(len(code)//4):
    codeChunk = code[(indx*4):((indx+1)*4)]
    opcode = codeChunk[1]
    encoding = codeChunk[0]
    fullStr = None
        
    if opcode == 0:
        name = "PrintR0R1"
        fullStr = "0"
    elif opcode == 1:
        name = "ADD"
        fullStr = defaultTwoOps(codeChunk, "+")
    elif opcode == 2:
        name = "SUB"
        fullStr = defaultTwoOps(codeChunk, "-")
    elif opcode == 3:
        name = "MUL"
        fullStr = defaultTwoOps(codeChunk, "*")
    elif opcode == 4:
        name = "DIV"
        fullStr = defaultTwoOps(codeChunk, "/")
    elif opcode == 5:
        name = "JMP"
        if encoding == 1:
            fullStr = "L%04d" % (codeChunk[2])
        elif encoding == 2:
            fullStr = "regs[%d]" % (codeChunk[2])
    elif opcode == 6:
        name = "JG"
        if encoding == 1:
            fullStr = "L%04d" % (codeChunk[2])
        elif encoding == 2:
            fullStr = "regs[%d]" % (codeChunk[2])
    elif opcode == 7:
        name = "JL"
        if encoding == 1:
            fullStr = "L%04d" % (codeChunk[2])
        elif encoding == 2:
            fullStr = "regs[%d]" % (codeChunk[2])
    elif opcode == 8:
        name = "JE"
        if encoding == 1:
            fullStr = "L%04d" % (codeChunk[2])
        elif encoding == 2:
            fullStr = "regs[%d]" % (codeChunk[2])
    elif opcode == 9:
        name = "JNE"
        if encoding == 1:
            fullStr = "L%04d" % (codeChunk[2])
        elif encoding == 2:
            fullStr = "regs[%d]" % (codeChunk[2])
    elif opcode == 0xA:
        name = "SET_FLAGS"
        if encoding == 0:
            fullStr = "regs[%d] == memory[regs[%d]]" % (codeChunk[2], codeChunk[3])
        elif encoding == 1:
            fullStr = "regs[%d] == 0x%08X" % (codeChunk[2], codeChunk[3])
        elif encoding == 2:
            fullStr = "regs[%d] == regs[%d]" % (codeChunk[2], codeChunk[3])
    elif opcode == 0xB:
        name = "AND"
        fullStr = defaultTwoOps(codeChunk, "&")
    elif opcode == 0xC:
        name = "OR"
        fullStr = defaultTwoOps(codeChunk, "|")
    elif opcode == 0xD:
        name = "XOR"
        fullStr = defaultTwoOps(codeChunk, "^")
    elif opcode == 0xE:
        name = "NOT"
        fullStr = "regs[%d] = !regs[%d]" % (codeChunk[2], codeChunk[2])
    elif opcode == 0xF:
        name = "MOV"
        if encoding == 0:
            fullStr = "regs[%d] = memory[regs[%d]]" % (codeChunk[2], codeChunk[3])
        elif encoding == 1:
            fullStr = "regs[%d] = 0x%08X" % (codeChunk[2], codeChunk[3])
        elif encoding == 2:
            fullStr = "regs[%d] = regs[%d]" % (codeChunk[2], codeChunk[3])
        elif encoding == 3:
            fullStr = "memory[%d] = regs[%d]" % (codeChunk[2], codeChunk[3])
    elif opcode == 0x10:
        name = "CALL"
        fullStr = "L%04d" % (codeChunk[2])
    elif opcode == 0x11:
        name = "RET"
        fullStr = ""
    elif opcode == 0x12:
        name = "PUSH"
        fullStr = "regs[%d]" % (codeChunk[2])
    elif opcode == 0x13:
        name = "POP"
        fullStr = "regs[%d]" % (codeChunk[2])
    elif opcode == 0x14:
        name = "SWAP"
        fullStr = "regs[%d] <-> regs[%d]" % (codeChunk[2], codeChunk[3])
    elif opcode == 0x15:
        name = "SHL"
        fullStr = defaultTwoOps(codeChunk, "<<")
    elif opcode == 0x16:
        name = "SHR"
        fullStr = defaultTwoOps(codeChunk, ">>")
    elif opcode == 0x17:
        name = "PUSHAD_ExceptR0R1"
        fullStr = ""
    elif opcode == 0x18:
        name = "POPAD_ExceptR0R1"
        fullStr = ""
    elif opcode == 0x19:
        name = "PrintR0R1"
        fullStr = "-1"
        
    print("L%04d" % indx, name, fullStr)